	public static boolean writeByteArraytoImageFile(String imageDataString, String fileName)
	{
		//String userProfilePicTempPath= LolaConstants.USERPROFILEPICTURE_TEMP_PTAH;
		boolean status = true;

		try{

			// Converting a Base64 String into Image byte array
			byte[] imageByteArray = decodeImage(imageDataString);

			// Write a image byte array into file system
			FileOutputStream imageOutFile = new FileOutputStream(fileName);

			imageOutFile.write(imageByteArray);


			imageOutFile.close();	 
			System.out.println("Image File :"+fileName+" created successfully!");

		}catch (FileNotFoundException e) {
			System.out.println("Image not found" + e);
			return status;
		} catch (IOException ioe) {
			System.out.println("Exception while reading the Image " + ioe);
			return status;
		}

		return status;
	}
	
	public static boolean writeImageStringtoImageFile(String imageDataString, String fileName)
	{
	//	String userProfilePicTempPath= LolaConstants.USERPROFILEPICTURE_TEMP_PTAH;
		boolean status = true;

		try{

			// Converting a Base64 String into Image byte array
			byte[] imageByteArray = decodeImage(imageDataString);

			// Write a image byte array into file system
			FileOutputStream imageOutFile = new FileOutputStream(fileName);

			imageOutFile.write(imageByteArray);


			imageOutFile.close();	 
			System.out.println("Image File :"+fileName+" created successfully!");

		}catch (FileNotFoundException e) {
			System.out.println("Image not found" + e);
			return status;
		} catch (IOException ioe) {
			System.out.println("Exception while reading the Image " + ioe);
			return status;
		}

		return status;
	}

	public static String compress(String str){
		
		String outPut="";
		ByteArrayOutputStream out = new ByteArrayOutputStream();
		
		if (str == null || str.length() == 0) {
			return str;
		}
		try
		{

			GZIPOutputStream gzip = new GZIPOutputStream(out);
			gzip.write(str.getBytes());
			gzip.close();
			outPut = out.toString("ISO-8859-1");
			
		}catch(Exception e)
		{
			System.out.println("Exception occured is :"+e+"   So returned non compressed String");
			return str;
		}
		return outPut;
	}


